std::tuple<torch::Tensor, torch::Tensor, torch::Tensor, torch::Tensor, torch::Tensor> 
    PermutoSDF::random_rays_from_reel(const TensorReel& reel, const int nr_rays){

    int nr_images=reel.rgb_reel.size(0);
    int img_height=reel.rgb_reel.size(2);
    int img_width=reel.rgb_reel.size(3);

    //return ray_origins, ray_dirs, gt_rgb, gt_mask
    Tensor ray_origins=torch::empty({ nr_rays, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor ray_dirs=torch::empty({ nr_rays, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor gt_rgb=torch::empty({ nr_rays, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor gt_mask=torch::empty({ nr_rays, 1 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );


    //make a tensor of random integers corresponding to the pixel that we sample from each image
    int nr_pixels=img_height*img_width;
    Tensor pixel_indices=torch::randint(0, nr_pixels, { nr_rays },  torch::dtype(torch::kInt32).device(torch::kCUDA, 0)  );
    //tensor saying fo each ray which image we get it from
    Tensor img_indices=torch::randint(0, nr_images, { nr_rays },  torch::dtype(torch::kInt32).device(torch::kCUDA, 0)  );


    const dim3 blocks = { (unsigned int)div_round_up(nr_rays, BLOCK_SIZE), 1, 1 };


    random_rays_from_reel_gpu<<<blocks, BLOCK_SIZE, 0, at::cuda::getCurrentCUDAStream()>>>(
        nr_rays,
        nr_images,
        img_height,
        img_width,
        reel.rgb_reel.packed_accessor32<float,4,torch::RestrictPtrTraits>(),
        reel.mask_reel.packed_accessor32<float,4,torch::RestrictPtrTraits>(),
        reel.K_reel.packed_accessor32<float,3,torch::RestrictPtrTraits>(),
        reel.tf_world_cam_reel.packed_accessor32<float,3,torch::RestrictPtrTraits>(),
        pixel_indices.packed_accessor32<int,1,torch::RestrictPtrTraits>(),
        img_indices.packed_accessor32<int,1,torch::RestrictPtrTraits>(),
        reel.has_mask,
        //output
        ray_origins.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        ray_dirs.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        gt_rgb.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        gt_mask.packed_accessor32<float,2,torch::RestrictPtrTraits>()
    );

    return std::make_tuple(ray_origins, ray_dirs, gt_rgb, gt_mask, img_indices);

}

std::tuple<torch::Tensor, torch::Tensor, torch::Tensor, torch::Tensor, torch::Tensor> 
    PermutoSDF::rays_from_reprojection_reel(const TensorReel& reel, const torch::Tensor& points_reprojected){

    int nr_images=reel.rgb_reel.size(0);
    int img_height=reel.rgb_reel.size(2);
    int img_width=reel.rgb_reel.size(3);
    int nr_points=points_reprojected.size(0);

    //return ray_origins, ray_dirs, gt_rgb, gt_mask
    Tensor ray_origins=torch::empty({ nr_points, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor ray_dirs=torch::empty({ nr_points, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor gt_rgb=torch::empty({ nr_points, 3 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );
    Tensor gt_mask=torch::empty({ nr_points, 1 },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );


    //make a tensor of random integers corresponding to the pixel that we sample from each image
    int nr_pixels=img_height*img_width;
    //we still take a random pixel indices because not all reprojections will end up inside the bounds of the image, and for out of bounds ones. We just take a random ray
    Tensor pixel_indices=torch::randint(0, nr_pixels, { nr_points },  torch::dtype(torch::kInt32).device(torch::kCUDA, 0)  );
    //tensor saying fo each ray which image we get it from
    Tensor img_indices=torch::randint(0, nr_images, { nr_points },  torch::dtype(torch::kInt32).device(torch::kCUDA, 0)  );


    const dim3 blocks = { (unsigned int)div_round_up(nr_points, BLOCK_SIZE), 1, 1 };


    rays_from_reprojection_reel_gpu<<<blocks, BLOCK_SIZE, 0, at::cuda::getCurrentCUDAStream()>>>(
        nr_points,
        nr_images,
        img_height,
        img_width,
        reel.rgb_reel.packed_accessor32<float,4,torch::RestrictPtrTraits>(),
        reel.mask_reel.packed_accessor32<float,4,torch::RestrictPtrTraits>(),
        reel.K_reel.packed_accessor32<float,3,torch::RestrictPtrTraits>(),
        reel.tf_cam_world_reel.packed_accessor32<float,3,torch::RestrictPtrTraits>(),
        reel.tf_world_cam_reel.packed_accessor32<float,3,torch::RestrictPtrTraits>(),
        pixel_indices.packed_accessor32<int,1,torch::RestrictPtrTraits>(),
        img_indices.packed_accessor32<int,1,torch::RestrictPtrTraits>(),
        reel.has_mask,
        points_reprojected.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        //output
        ray_origins.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        ray_dirs.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        gt_rgb.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        gt_mask.packed_accessor32<float,2,torch::RestrictPtrTraits>()
    );

    return std::make_tuple(ray_origins, ray_dirs, gt_rgb, gt_mask, img_indices);

}


//similar to https://github.com/NVlabs/tiny-cuda-nn/blob/bd29d77c589e7593680a3aa508e35a0136df904b/include/tiny-cuda-nn/encodings/spherical_harmonics.h
torch::Tensor PermutoSDF::spherical_harmonics(const torch::Tensor& dirs, const int degree){

    CHECK(dirs.size(1)==3) << "We are assuming that dirs should be Nx3";
    CHECK(dirs.dim()==2) << "We are assuming dirs has 2 dimensions so Nx3";

    
    int nr_elements=dirs.size(0);
    int nr_channels_encoded=-1;
    if (degree==1){ nr_channels_encoded=1; };
    if (degree==2){ nr_channels_encoded=4; };
    if (degree==3){ nr_channels_encoded=9; };
    if (degree==4){ nr_channels_encoded=16; };
    if (degree==5){ nr_channels_encoded=25; };
    if (degree==6){ nr_channels_encoded=36; };
    if (degree==7){ nr_channels_encoded=49; };
    CHECK(nr_channels_encoded>0) <<"Nr channels encoded is not valid. Maybe you gave a degree number that is not supported.";

    

    Tensor dirs_encoded=torch::empty({ nr_elements, nr_channels_encoded },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );



    const dim3 blocks = { (unsigned int)div_round_up(nr_elements, BLOCK_SIZE), 1, 1 }; 


    spherical_harmonics_gpu<<<blocks, BLOCK_SIZE, 0, at::cuda::getCurrentCUDAStream()>>>(
        nr_elements,
        degree,
        dirs.packed_accessor32<float,2,torch::RestrictPtrTraits>(),
        dirs_encoded.packed_accessor32<float,2,torch::RestrictPtrTraits>()
    );
        
   

    return dirs_encoded;

}

torch::Tensor PermutoSDF::update_errors_of_matching_indices(const torch::Tensor& old_indices, const torch::Tensor& old_errors, const torch::Tensor& new_indices, const torch::Tensor& new_errors){

    CHECK(old_indices.dim()==1) << "old_indices has to have 1 dimension";
    CHECK(old_errors.dim()==1) << "old_errors has to have 1 dimension";
    CHECK(new_indices.dim()==1) << "new_indices has to have 1 dimension";
    CHECK(new_errors.dim()==1) << "new_errors has to have 1 dimension";

    int nr_old_errors=old_errors.size(0);
    int nr_new_errors=new_errors.size(0);

    Tensor updated_errors=torch::empty({ nr_old_errors },  torch::dtype(torch::kFloat32).device(torch::kCUDA, 0)  );

    const dim3 blocks = { (unsigned int)div_round_up(nr_old_errors, BLOCK_SIZE), 1, 1 }; //the blocks are executed in order, first the blocks for the first resolution, then the second and so on

    update_errors_of_matching_indices_gpu<<<blocks, BLOCK_SIZE, 0, at::cuda::getCurrentCUDAStream()>>>(
        nr_old_errors,
        nr_new_errors,
        old_indices.packed_accessor32<long,1,torch::RestrictPtrTraits>(),
        old_errors.packed_accessor32<float,1,torch::RestrictPtrTraits>(),
        new_indices.packed_accessor32<long,1,torch::RestrictPtrTraits>(),
        new_errors.packed_accessor32<float,1,torch::RestrictPtrTraits>(),
        updated_errors.packed_accessor32<float,1,torch::RestrictPtrTraits>()
    );

    return updated_errors;

}

