//low discrepancy sampling based on:
//https://github.com/dcoeurjo/LowDiscBlueNoise/blob/master/lutLDBN.h
// std::vector<unsigned> PermutoSDF::init_sampler(){
static std::vector<unsigned> init_sampler(){
    std::vector<unsigned> mirror(256);
    for (unsigned i = 0; i < 256; i++) {
        mirror[i] = (i >> 7) + ((i >> 5) & 2) + ((i >> 3) & 4) + ((i >> 1) & 8)
        + ((i << 1) & 16) + ((i << 3) & 32) + ((i << 5) & 64) + ((i << 7) & 128);
    }
    return mirror;
}
double PermutoSDF::phi(const unsigned &i){
  const unsigned ONE = 0x1000000;                                             // 24 bits is considered sufficient
  const double scl = 1.0 / ONE;
  return scl * (
                mirror[(i >> 16) & 255] +
                (mirror[(i >> 8) & 255] << 8) +
                (mirror[i & 255] << 16)
                );
}
Eigen::VectorXi PermutoSDF::low_discrepancy2d_sampling(const int nr_samples, const int height, const int width){

    //we make more samples because we create them in a square an we lose some due to cropping if the image is not square 
    float upscale_factor=(float)width/height;
    int nr_samples_upscaled=nr_samples*upscale_factor;

    int nr_samples_per_side= std::floor(std::sqrt((double)nr_samples_upscaled));
    int max_img_size= std::max(height, width);
    float space_between_samples=(float)max_img_size/(float)nr_samples_per_side;

    // std::cout << "height and width is " << height << " " << width << std::endl; 
    // VLOG(1) << " space_between_samples " << space_between_samples;

    //make a 2D grid of samples
    std::vector< Eigen::Vector2d > grid_2d;
    for (unsigned Y = 0; Y < nr_samples_per_side; Y++) {
        for (unsigned X = 0; X < nr_samples_per_side; X++) {
            Eigen::Vector2d point;
            point<<X*space_between_samples,Y*space_between_samples;
            // VLOG(1) << "X is " << point.x();
            if (point.x()<width && point.y()<height ){
                grid_2d.push_back(point);
            }
        }
    }


    //randomly shift the grid in x and y
    int random_shift_x=m_rand_gen_static->rand_int(0, 9999999);
    int random_shift_y=m_rand_gen_static->rand_int(0, 9999999);
    // VLOG(1) << "random_shift_x"<< random_shift_x;
    for (unsigned i = 0; i < grid_2d.size(); i++) {
        grid_2d[i].x()=grid_2d[i].x()+random_shift_x;
        grid_2d[i].y()=grid_2d[i].y()+random_shift_y;
    }




    //low discrepancy
    // double inv = 1.0 / n;
    unsigned mask = 128 - 1;                                                      // t should be a power of 2.
    unsigned shift = std::log2(128);
    // for (unsigned Y = 0; Y < n; Y++) {
        // for (unsigned X = 0; X < n; X++) {
    for (unsigned i = 0; i < grid_2d.size(); i++) {
        int X=int(grid_2d[i].x());
        int Y=int(grid_2d[i].y());
        unsigned index = ((Y & mask) << shift) + (X & mask);
        double u = phi( (Y & 0xfffffff0) + (lutLDBN_BNOT[index] & 0xf) );
        double v = phi( (X & 0xfffffff0) + (lutLDBN_BNOT[index] >> 4) );
        // p[0] = inv * (X + u);
        // p[1] = inv * (Y + v);
        // samples.push_back(p);
        // }
        // VLOG(1) << "u and v is " << u << " " << v;
        grid_2d[i].x()=(X + u*space_between_samples);
        grid_2d[i].y()=(Y + v*space_between_samples);
    }





    //make 2d points into 1D indices
    auto points_to_flatten=grid_2d;
    Eigen::VectorXi indices;
    indices.resize(points_to_flatten.size());
    for (unsigned i = 0; i < indices.rows(); i++) {
        Eigen::Vector2d point=points_to_flatten[i];
        int idx=idx_2D_to_1D_wrap(int(point.x()), int(point.y()), width, height);
        indices(i)=idx;
    }

    return indices;


}




