    // std::tuple<torch::Tensor, torch::Tensor, torch::Tensor, torch::Tensor> PermutoSDF::render_atributes(const std::shared_ptr<easy_pbr::Mesh>& mesh, const easy_pbr::Frame frame){
    torch::Tensor PermutoSDF::render_atributes(const std::shared_ptr<easy_pbr::Mesh>& mesh, const easy_pbr::Frame frame){

        // VLOG(1) <<"rendering";


        //enable culling because we don't want to render on the inside of the shoulders
        glEnable(GL_CULL_FACE);
        glCullFace(GL_BACK);


        //sanity check
        CHECK(mesh->UV.rows()==mesh->V.rows()) << "Mesh uv has to match the V. UV is " << mesh->UV.rows() << " V is " << mesh->V.rows();
        CHECK(mesh->NV.rows()==mesh->V.rows()) << "Mesh NV has to match the V. NV is " << mesh->NV.rows() << " V is " << mesh->V.rows();
        


        TIME_START("c_ra_init");
        //initialize stuff
        //set the gbuffer size in case it changed
        if(frame.width!=m_atrib_gbuffer.width() || frame.height!=m_atrib_gbuffer.height()){
            GL_C( m_atrib_gbuffer.set_size(frame.width, frame.height) );
        }
        m_atrib_gbuffer.bind_for_draw();
        m_atrib_gbuffer.clear();
        // m_uvt_gbuffer.clear_depth();
        // m_atrib_gbuffer.tex_with_name("xyzX_gtex").set_constant(0);
        // m_atrib_gbuffer.tex_with_name("view_dirX_gtex").set_constant(0);
        // m_atrib_gbuffer.tex_with_name("normalX_gtex").set_constant(0);
        m_atrib_gbuffer.tex_with_name("uv_gtex").set_constant(0);
        TIME_END("c_ra_init");

        // //upload the meshes to gpu
        m_view->upload_single_mesh_to_gpu(mesh, /*is_meshgl_sticky*/ true);
        auto mesh_gl= mesh->m_mesh_gpu.lock();
        CHECK(mesh_gl) << "We need a mesh_gl";

        //opengl stuff
        GL_C( glViewport(0.0f , 0.0f, frame.width, frame.height ) );

        //setup camera things for the rendering
        Eigen::Matrix4f M, V, P, MV, MVP;
        easy_pbr::Camera cam;
        cam.from_frame(frame);
        V = cam.view_matrix();
        P = cam.proj_matrix(m_atrib_gbuffer.width(), m_atrib_gbuffer.height());





        //render mesh and it's artibutes
        /////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        {
        glDisable(GL_CULL_FACE); //let it render also the back of the head because some synthetic meshes dont have eyeballd
        // gl::Shader& shader = m_depth_only_shader;
        gl::Shader& shader = m_atrib_shader;
        mesh_gl->vao.vertex_attribute(shader, "position", mesh_gl->V_buf, 3);
        mesh_gl->vao.vertex_attribute(shader, "normal", mesh_gl->NV_buf, 3);
        mesh_gl->vao.vertex_attribute(shader, "uv", mesh_gl->UV_buf, 2);
        mesh_gl->vao.indices(mesh_gl->F_buf); //Says the indices with we refer to vertices, this gives us the triangles
        //matrices
        M=mesh->model_matrix().cast<float>().matrix();
        MVP = P*V*M;
        MV=V*M;
        //shader setup
        shader.use();
        shader.uniform_4x4(MVP, "MVP");
        // shader.uniform_4x4(MV, "MV");
        shader.draw_into(m_atrib_gbuffer, {
                                        // std::make_pair("xyz_out", "xyzX_gtex"),
                                        // std::make_pair("view_dir_out", "view_dirX_gtex"),
                                        // std::make_pair("normal_out", "normalX_gtex"),
                                        std::make_pair("uv_out", "uv_gtex"),
                                        }
                                        ); //makes the shaders draw into the buffers we defines in the gbuffer
        // draw
        mesh_gl->vao.bind();
        glDrawElements(GL_TRIANGLES, mesh->F.size(), GL_UNSIGNED_INT, 0);
        }




    


        //xyz tensor
        // m_atrib_gbuffer.tex_with_name("xyzX_gtex").enable_cuda_transfer();
        // torch::Tensor xyzX_tensor=m_atrib_gbuffer.tex_with_name("xyzX_gtex").to_tensor();
        // torch::Tensor xyz_tensor=xyzX_tensor.slice(1, 0, 3);
        // xyzX_tensor=torch::flip(xyzX_tensor,{2});

        // //view_dir
        // m_atrib_gbuffer.tex_with_name("view_dirX_gtex").enable_cuda_transfer();
        // torch::Tensor view_dirX_tensor=m_atrib_gbuffer.tex_with_name("view_dirX_gtex").to_tensor();
        // torch::Tensor view_dir_tensor=view_dirX_tensor.slice(1, 0, 3);
        // view_dir_tensor=torch::flip(view_dir_tensor,{2});

        // //normal
        // m_atrib_gbuffer.tex_with_name("normalX_gtex").enable_cuda_transfer();
        // torch::Tensor normalX_tensor=m_atrib_gbuffer.tex_with_name("normalX_gtex").to_tensor();
        // torch::Tensor normal_tensor=normalX_tensor.slice(1, 0, 3);
        // normal_tensor=torch::flip(normal_tensor,{2});

        //uv
        m_atrib_gbuffer.tex_with_name("uv_gtex").enable_cuda_transfer();
        torch::Tensor uv_tensor=m_atrib_gbuffer.tex_with_name("uv_gtex").to_tensor();
        uv_tensor=torch::flip(uv_tensor,{2});



    

        //restore state
        glDisable(GL_CULL_FACE);


        // return full_atribs;
        // auto ret = std::make_tuple (xyz_tensor, view_dir_tensor, normal_tensor, uv_tensor);
        auto ret = uv_tensor;
        return ret;

    }
